import Month from './Month';

let year;
let months = [];
export default class Year{
    newYear = (yearIn)=>{
        year = yearIn;
        console.log(`this year is ${this.getYear()}`);
    }
    get getYear(){
        return this.year;
    }
    addMonth(monthIn){
        months.push(monthIn);
    }
}
